import Sun from '../image/light-mode.png'
 import Moon from '../image/moon.png'
import { useState } from 'react'
export const Header = () => {
   const [DarckMode, setDarckMode] = useState(false);
   function getDarckMode (){
    setDarckMode(!DarckMode)
   }
    return(
        <div className="header">
            <div className='header-text'>
                <h3>Where is the world?</h3>
            </div>
            <div className='header-left-aside' onClick={getDarckMode}>
            <img className="sun" src={Sun} alt="icon-sun" onClick={!Sun}/> 
                {DarckMode ? "Darck Mode": "Light Mode"}

                <span className='mode'><p></p></span>
            </div>
        </div>
    )
}
